    private static Integer subString(String s) {
        if(s == null || s.isEmpty()){
            return 0;
        }

        int length = 0;
        List<Object> list = new ArrayList<>();

        char[] chars = s.toCharArray();
        for (char aChar : chars) {
            if (list.contains(aChar)) {
                int size = list.size();
                if (size > length) {
                    length = size;
                }
                int index = list.indexOf(aChar);
                if (index >= 0) {
                    list.subList(0, index + 1).clear();
                }
            }

            list.add(aChar);
        }

        return Math.max(length, list.size());
    }



